function postTemplate (date, title, body, description, jumplink, published, author) {
  let desc = ''
  if (description && description !== '') {
    desc = 'description:  |\n'
    desc += description.replace(/^[ \t]*/gm, '  ')
  }

  let jl = ''
  if (jumplink) {
    jl = `jumplink: ${jumplink}`
  }

  if (!author || author === '') {
    author = 'Notes'
  }

  return `---
layout: post
published: ${published}
author: ${author}
title:  |
  ${title}
date:   ${date}
${desc}
${jl}
---

${body}
`
}

